DROP TABLE IF EXISTS `mcp_interface`;
CREATE TABLE `mcp_interface` (
  `PK` int(20) NOT NULL AUTO_INCREMENT,
  `PARAMTER_ADDRESS` varchar(256) DEFAULT NULL COMMENT '外围系统获取平台参数地址',
  `TASK_SUBMIT_ADDRESS` varchar(256) DEFAULT NULL COMMENT '外围系统任务提交地址',
  `TASK_PROGRESS_ADDRESS` varchar(256) DEFAULT NULL COMMENT '外围系统获取任务进度地址',
  `NODE_TASKSTATE_ADDRESS` varchar(256) DEFAULT NULL COMMENT '服务节点回调任务状态地址',
  `SPARE_REPORT_ADDRESS` varchar(256) DEFAULT NULL COMMENT '备用服务节点回调任务状态地址',
  `NODE_MONITORING_ADDRESS` varchar(256) DEFAULT NULL COMMENT '服务节点状态汇报(监控)地址node resource callback address',
  `CREATE_USER` varchar(32) DEFAULT NULL COMMENT '创建人',
  `CREATE_TIME` datetime DEFAULT NULL COMMENT '创建时间',
  `UPDATE_USER` varchar(32) DEFAULT NULL COMMENT '修改人',
  `UPDATE_TIME` datetime DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`PK`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='平台对外接口注册';

