-- ----------------------------
-- Table structure for mcp_task
-- ----------------------------
DROP TABLE IF EXISTS `mcp_task`;
CREATE TABLE `mcp_task` (
  `PK` int(20) NOT NULL AUTO_INCREMENT,
  `PLATFORM_ID` varchar(32) NOT NULL DEFAULT '' COMMENT '平台任务ID',
  `SYSTEM_ID` varchar(32) NOT NULL DEFAULT '' COMMENT '外围系统ID',
  `TASK_ID` varchar(128) NOT NULL DEFAULT '' COMMENT '外围系统任务ID',
  `TASK_NAME` varchar(255) DEFAULT NULL COMMENT '任务名称',
  `PRIORITY` int(10) NOT NULL DEFAULT '0' COMMENT '任务优先级',
  `TASK_GROUP` varchar(32) NOT NULL DEFAULT '' COMMENT '任务分组',
  `TASK_TYPE` varchar(32) NOT NULL DEFAULT '' COMMENT '任务类型',
  `TASK_INFO` longtext COMMENT '任务内容',
  `TASK_STATE` int(5) DEFAULT NULL COMMENT '任务状态-1waiting 0 Success 1Processing 2 Fail',
  `TASK_PROGRESS` int(5) DEFAULT NULL COMMENT '任务进度',
  `RETRY_COUNT` int(2) DEFAULT NULL COMMENT '重发次数',
  `DELETE_FLAG` int(2) NOT NULL DEFAULT '0' COMMENT '任务有效标识(1删除)',
  `TASKCALLBACK_ADDRESS` varchar(200) DEFAULT NULL COMMENT '任务状态回调地址(外围系统)',
  `REMARK` varchar(512) DEFAULT NULL COMMENT '描述',
  `CREATE_USER` varchar(32) DEFAULT NULL COMMENT '创建人',
  `CREATE_TIME` datetime DEFAULT NULL COMMENT '创建时间(接收时间)receiving',
  `UPDATE_USER` varchar(32) DEFAULT NULL COMMENT '修改人',
  `UPDATE_TIME` datetime DEFAULT NULL COMMENT '修改时间(发送时间)send',
  `PROCESSING_RESULTS` longtext COMMENT '处理结果',
  `COMPLETE_TIME` datetime DEFAULT NULL COMMENT '完成时间finish',
  `DEALFLAG` varchar(10) DEFAULT NULL COMMENT '处理标识(增删改)',
  PRIMARY KEY (`PK`),
  KEY `MCP_PLATFORM_ID` (`PLATFORM_ID`)
) ENGINE=InnoDB AUTO_INCREMENT=271 DEFAULT CHARSET=utf8 COMMENT='任务表';

